      <div className="break"></div>
      {issue[1]}
      <div className="break"></div>
      {issue[2]}
      <div className="break"></div>
      {issue[3]}
      <div className="break"></div>
      {issue[4]}
      <div className="break"></div>
      {issue[5]}
      <div className="break"></div> */}
    </div>
  );
};

export default IssueCard;
